// Method 1: Using a function

function addNumbers(num1, num2) {
  return num1 + num2;
}

// Example usage:
let number1 = 5;
let number2 = 10;
let sum = addNumbers(number1, number2);
console.log("The sum of " + number1 + " and " + number2 + " is: " + sum); // Output: The sum of 5 and 10 is: 15


// Method 2:  Directly adding numbers without a function

let a = 20;
let b = 7;
let result = a + b;
console.log("The sum is: " + result); // Output: The sum is: 27


// Method 3: Using arrow function (more concise)

const add = (x, y) => x + y;

//Example Usage
let num_1 = 12;
let num_2 = 8;

console.log(`The sum of ${num_1} and ${num_2} is: ${add(num_1, num_2)}`);  // Output: The sum of 12 and 8 is: 20


